/** @format */

import React from "react";
import styles from "./To_mn.module.css";

function To_mn() {
  return (
    <div className={styles.Top_mn_Main}>
      <div className={styles.Top_mn_body}>
        <div className={styles.Top_mn_logo}>
          <a href="/">Laftel</a>
        </div>
        <div className={styles.Top_mn_menu}>
          <a href="/finder">태그검색</a>
          <a href="/daily">요일별 신작</a>
          <a href="/themes">테마추천</a>
          <a href="/membership">멤버쉽</a>
        </div>
        <div className="{styles.Top_mn_login}"></div>
      </div>
    </div>
  );
}

export default To_mn;
